import { Col, Container, Row } from "react-bootstrap";
import "./Services.css";
function Services() {
  return (
    <Container className="mt-3" style={{backgroundColor:"#F7EDE2"}}>
      <div className="title">
        <h2>Our Services</h2>
      </div>
      <Row>
        <Col></Col>
      </Row>
    </Container>
  );
}
export default Services;
